DROP TABLE IF EXISTS `todos`;

CREATE TABLE `todos` (
  `id` char(36) NOT NULL,
  `name` varchar(255) NOT NULL,
  `list_id` char(36) NOT NULL,
  `completed_at` datetime DEFAULT NULL,
  `updated_at` timestamp NOT NULL,
  `created_at` datetime NOT NULL DEFAULT CURRENT_TIMESTAMP,
  PRIMARY KEY (`id`)
);

